import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = ({ user, onLogout }) => {
  const location = useLocation();

  const navItems = [
    { path: '/dashboard', label: 'Dashboard', icon: 'üè†' },
    { path: '/trading', label: 'Trading', icon: 'üìà' },
    { path: '/kyc', label: 'KYC', icon: 'üÜî' },
    { path: '/profile', label: 'Profile', icon: 'üë§' },
  ];

  return (
    <nav style={{ background: '#1e2329', padding: '0', borderBottom: '1px solid #2b3139', height: '64px' }}>
      <div className="container" style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '0' }}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <h2 style={{ color: 'white', margin: '0 30px 0 0' }}>P2P Trading</h2>
          <div style={{ display: 'flex' }}>
            {navItems.map((item) => (
              <Link
                key={item.path}
                to={item.path}
                style={{
                  display: 'flex',
                  alignItems: 'center',
                  padding: '15px 20px',
                  color: 'white',
                  textDecoration: 'none',
                  backgroundColor: location.pathname === item.path ? '#495057' : 'transparent',
                }}
              >
                <span style={{ marginRight: '8px' }}>{item.icon}</span>
                {item.label}
              </Link>
            ))}
          </div>
        </div>

        <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
          <div style={{ color: 'white', fontSize: '14px' }}>
            <div>‚Çπ{user?.wallets?.inr?.toFixed(2) || '0.00'}</div>
            <div>{user?.wallets?.usdt?.toFixed(6) || '0.000000'} USDT</div>
          </div>
          <button
            onClick={onLogout}
            className="btn btn-danger"
          >
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
